import React, {Component} from 'react';


class Creecov extends Component {
	render(){
		return(
			<div width="90%" height="70%" className="pa2 center bg-light-green br3 ma2 grow  shadow-5 center">
				<form>
 					 <input type="radio" id="Simple" name="gender" value="Simple" />
 					 <label for="Simple">Simple</label><br/>
  					 <input type="radio" id="Avancée" name="gender" value="Avancée" />
  					 <label for="Avancée">Avancée</label><br/>
				</form>
			</div>
			);
	}


}

export default Creecov;
